  <a className={css.disabled} style={{background: `url(${props.bgImgUrl}) center no-repeat`, backgroundSize: "100%"}} target="_blank" className={css.itemContainer}>
    <div className={css.textContainer}>
      <h4 className={css.itemTitle}>{props.name}</h4>
      <div className={css.techUsedContainer}>
        <div>web-app</div>
        <div>php</div>
      </div>
    </div>
  </a>
  </Link>
);

export default PortfolioItem;
